import React, { useState } from 'react';

const PathFinderUI = () => {
  const [fromNode, setFromNode] = useState('');
  const [toNode, setToNode] = useState('');
  const [result, setResult] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);

  const nodes = ['A', 'B', 'C', 'D', 'E', 'F', 'G', 'H', 'I'];

  const handleCalculate = async () => {
    if (!fromNode || !toNode) {
      setError('Please select both nodes');
      return;
    }

    setLoading(true);
    setError(null);

    // Simulate an API call for calculating the shortest path
    setTimeout(() => {
      setResult({
        nodeNames: ['A', 'B', 'C', 'D'], // Example path
        distance: 10, // Example distance
      });
      setLoading(false);
    }, 1000);
  };

  const handleClear = () => {
    setFromNode('');
    setToNode('');
    setResult(null);
    setError(null);
  };

  return (
    <div className="min-h-screen bg-gradient-to-b from-blue-600 to-blue-50">
      <div className="max-w-4xl mx-auto pt-16 px-6">
        <h1 className="text-3xl font-semibold text-white text-center">
          Dijkstra's Algorithm Calculator
        </h1>
        <p className="text-white text-center mt-2 mb-8">
          Discovering Optimal Routes Through Nodes Using Dijkstra's Method
        </p>

        {/* Main Card */}
        <div className="bg-white rounded-lg shadow-lg p-6">
          <div className="grid grid-cols-1 md:grid-cols-2 gap-8">
            {/* Left Section */}
            <div>
              <h2 className="text-blue-900 font-medium mb-4">Select Path</h2>
              <div className="space-y-4">
                <div>
                  <label className="block text-gray-600 text-sm mb-1">
                    From Node
                  </label>
                  <select
                    value={fromNode}
                    onChange={(e) => setFromNode(e.target.value)}
                    className="w-full p-2 border border-gray-300 rounded focus:ring-2 focus:ring-blue-500 focus:border-transparent"
                  >
                    <option value="">Select</option>
                    {nodes.map(node => (
                      <option key={node} value={node}>{node}</option>
                    ))}
                  </select>
                </div>

                <div>
                  <label className="block text-gray-600 text-sm mb-1">
                    To Node
                  </label>
                  <select
                    value={toNode}
                    onChange={(e) => setToNode(e.target.value)}
                    className="w-full p-2 border border-gray-300 rounded focus:ring-2 focus:ring-blue-500 focus:border-transparent"
                  >
                    <option value="">Select</option>
                    {nodes.map(node => (
                      <option key={node} value={node}>{node}</option>
                    ))}
                  </select>
                </div>

                <div className="flex space-x-3 pt-2">
                  <button
                    onClick={handleClear}
                    className="px-4 py-2 text-gray-600 bg-gray-100 rounded hover:bg-gray-200 transition-colors duration-200"
                  >
                    Clear
                  </button>
                  <button
                    onClick={handleCalculate}
                    disabled={loading}
                    className="px-4 py-2 text-white bg-orange-500 rounded hover:bg-orange-600 transition-colors duration-200 disabled:opacity-50 disabled:cursor-not-allowed"
                  >
                    {loading ? 'Calculating...' : 'Calculate'}
                  </button>
                </div>

                {error && (
                  <p className="text-red-500 text-sm mt-2">{error}</p>
                )}
              </div>
            </div>

            {/* Right Section */}
            <div className="flex items-center justify-center">
              <div className="w-full h-40 bg-gray-50 p-4 rounded-lg flex items-center justify-center">
                {result ? (
                  <div className="space-y-2 text-gray-600">
                    <p>
                      From Node "{fromNode}" to Node "{toNode}": {result.nodeNames.join(', ')}
                    </p>
                    <p>Total Distance: {result.distance}</p>
                  </div>
                ) : (
                  <p className="text-gray-400">
                    {loading ? 'Calculating...' : 'Select nodes to calculate path'}
                  </p>
                )}
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default PathFinderUI;
